            cellClass: 'number',
            valueFormatter: numberCellFormatter,
            cellRenderer: 'agAnimateShowChangeCellRenderer',
        },
        {
            headerName: 'Change',
            valueGetter: changeValueGetter,
            width: 200,
            aggFunc: 'sum',
            enableValue: true,
            cellClass: 'number',
            valueFormatter: numberCellFormatter,
            cellRenderer: 'agAnimateShowChangeCellRenderer',
        },
        {
            headerName: 'PL 1',
            field: 'pl1',
            width: 200,
            aggFunc: 'sum',
            enableValue: true,
            cellClass: 'number',
            valueFormatter: numberCellFormatter,
            cellRenderer: 'agAnimateShowChangeCellRenderer',
        },
        {
            headerName: 'PL 2',
            field: 'pl2',
            width: 200,
            aggFunc: 'sum',
            enableValue: true,
            cellClass: 'number',
            valueFormatter: numberCellFormatter,
            cellRenderer: 'agAnimateShowChangeCellRenderer',
        },
        {
            headerName: 'Gain-DX',
            field: 'gainDx',
            width: 200,
            aggFunc: 'sum',
            enableValue: true,
            cellClass: 'number',
            valueFormatter: numberCellFormatter,
            cellRenderer: 'agAnimateShowChangeCellRenderer',
        },
        {
            headerName: 'SX / PX',
            field: 'sxPx',
            width: 200,
            aggFunc: 'sum',
            enableValue: true,
            cellClass: 'number',
            valueFormatter: numberCellFormatter,
            cellRenderer: 'agAnimateShowChangeCellRenderer',
        },
        {
            headerName: '99 Out',
            field: '_99Out',
            width: 200,
            aggFunc: 'sum',
            enableValue: true,
            cellClass: 'number',
            valueFormatter: numberCellFormatter,
            cellRenderer: 'agAnimateShowChangeCellRenderer',
        },
        {
            headerName: 'Submitter ID',
            field: 'submitterID',
            width: 200,
            aggFunc: 'sum',
            enableValue: true,
            cellClass: 'number',
            valueFormatter: numberCellFormatter,
            cellRenderer: 'agAnimateShowChangeCellRenderer',
        },
        {
            headerName: 'Submitted Deal ID',
            field: 'submitterDealID',
            width: 200,
            aggFunc: 'sum',
            enableValue: true,
            cellClass: 'number',
            valueFormatter: numberCellFormatter,
            cellRenderer: 'agAnimateShowChangeCellRenderer',
        },
        // some string values, that do not get aggregated
        {
            field: 'dealType',
            enableRowGroup: true,
            enablePivot: true,
            filter: 'agTextColumnFilter',
        },
        {
            headerName: 'Bid',
            field: 'bidFlag',
            enableRowGroup: true,
            enablePivot: true,
            width: 100,
            filter: 'agTextColumnFilter',
        },
        { field: 'comment', editable: true, filter: 'agTextColumnFilter' },
    ]);
    const defaultColDef = useMemo(() => {
        return {
            width: 120,
            filter: 'agNumberColumnFilter',
        };
    }, []);
    const autoGroupColumnDef = useMemo(() => {
        return {
            width: 250,
            field: 'trade',
            cellRendererParams: {
                checkbox: true,
            },
        };
    }, []);
    const getRowId = useCallback(function (params) {
        return String(params.data.trade);
    }, []);

    const updateData = useCallback(() => {
        const rowData = globalRowData.splice(0);
        removeSomeItems(rowData);
        addSomeItems(rowData);
        updateSomeItems(rowData);
        setGlobalData(rowData);
    }, [globalRowData]);

    // update rowData when our "global store" updates
    useEffect(() => setRowData(globalRowData), [globalRowData]);

    return (
        <div style={containerStyle}>
            <div className="example-wrapper">
                <div style={{ marginBottom: '5px' }}>
                    <button onClick={updateData}>Update</button>
                </div>

                <div
                    style={gridStyle}
                    className={
